script: |
  super -f tsv -I q6450.sql | sort > q6450.out

vector: true

inputs:
  - name: q6450.sql
    data: |
      SELECT DISTINCT + + col0 FROM tab2 WHERE NOT NULL BETWEEN col1 * - 36 * col0 * + ( + 90 ) / + col1 + + 35 + CAST ( - col0 AS INTEGER ) / + + col0 AND NULL;
  - name: tab2

outputs:
  - name: q6450.out
    data: |
